            "href": "https://stedolan.github.io/jq/download/"
          }}>{`jq 安装`}</a></p></div></div>
    <h2 {...{
      "id": "1-rancher-ui-获取创建集群参数"
    }}>{`1. Rancher UI 获取创建集群参数`}</h2>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`访问`}<inlineCode parentName="p">{`Rancher_URL/v3/clusters/`}</inlineCode>{`，单击右上角“Create”，创建导入集群：`}</p>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/old-doc/image-20191213210405727.png",
            "alt": "image-20191213210405727"
          }}></img></p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`在参数填写页面中，修改以下参数:`}</p>
        <ul parentName="li">
          <li parentName="ul">
            <p parentName="li"><inlineCode parentName="p">{`dockerRootDir`}</inlineCode>{`
默认为`}<inlineCode parentName="p">{`/var/lib/docker`}</inlineCode>{`,如果 dockerroot 路径有修改，需要修改此配置路径；`}</p>
          </li>
          <li parentName="ul">
            <p parentName="li"><inlineCode parentName="p">{`enableClusterAlerting`}</inlineCode>{`(可选)
根据需要选择是否默认开启集群告警；`}</p>
          </li>
          <li parentName="ul">
            <p parentName="li"><inlineCode parentName="p">{`enableClusterMonitoring`}</inlineCode>{`(可选)
根据需要选择是否默认开启集群监控；`}</p>
          </li>
          <li parentName="ul">
            <p parentName="li"><inlineCode parentName="p">{`name`}</inlineCode>{`(必填)
设置集群名称，名称具有唯一性，不能与现有集群名称相同；`}</p>
          </li>
        </ul>
      </li>
      <li parentName="ol">
        <p parentName="li">{`配置好参数后单击`}<inlineCode parentName="p">{`Show Request`}</inlineCode>{`；`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`在弹出的窗口中，复制`}<inlineCode parentName="p">{`API Request`}</inlineCode>{`中`}<inlineCode parentName="p">{`HTTP Request:`}</inlineCode>{`的`}<inlineCode parentName="p">{`{}`}</inlineCode>{`中的内容，此内容即为创建的集群的 API 参数；`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-bash"
          }}>{`#!/bin/bash

api_url='https://xxx.rancher.com/v3/clusters'
api_token='token-vrdkx:mvnrxxxxxxxxxnxzfx4h2gjkdtzzv97sw7brz66454'
cluster_name='test-import'

create_cluster_data()
{
  cat <<EOF
{
    "aliyunEngineConfig": null,
    "amazonElasticContainerServiceConfig": null,
    "answers": null,
    "azureKubernetesServiceConfig": null,
    "baiduEngineConfig": null,
    "dockerRootDir": "/var/lib/docker",
    "enableClusterAlerting": true,
    "enableClusterMonitoring": true,
    "googleKubernetesEngineConfig": null,
    "huaweiEngineConfig": null,
    "localClusterAuthEndpoint": null,
    "name": "test-import",
    "rancherKubernetesEngineConfig": null,
    "tencentEngineConfig": null,
    "windowsPreferedCluster": false
}
EOF
}

curl -k -X POST \\
    -H "Authorization: Bearer \${api_token}" \\
    -H "Content-Type: application/json" \\
    -d "$(create_cluster_data)" $api_url/v3/clusters
`}</code></pre>
      </li>
    </ol>
    <h2 {...{
      "id": "2-创建集群"
    }}>{`2. 创建集群`}</h2>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`保存以上代码为脚本文件，修改前三行的变量与配置中的参数（比如：dockerRootDir ），最后执行脚本。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`脚本执行完成后，集群状态如下所示，其状态为`}<inlineCode parentName="p">{`Provisioning;`}</inlineCode></p>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/old-doc/image-20191213212549253.png",
            "alt": "image-20191213212549253"
          }}></img></p>
      </li>
    </ol>
    <h2 {...{
      "id": "3-创建注册命令"
    }}>{`3. 创建注册命令`}</h2>
    <p>{`复制并保存以下内容为脚本文件，修改前三行`}<inlineCode parentName="p">{`api_url`}</inlineCode>{`、`}<inlineCode parentName="p">{`token`}</inlineCode>{`、`}<inlineCode parentName="p">{`cluster_name`}</inlineCode>{`，然后执行脚本。`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`#!/bin/bash

api_url='https://xxx.domain.com'
api_token='token-5zgl2:tcj5nvfq67rf55r7xxxxxxxxxxx429xrwd4zx'
cluster_name=''

# 获取集群ID
cluster_ID=$( curl -s -k -H "Authorization: Bearer \${api_token}" $api_url/v3/clusters | jq -r ".data[] | select(.name == \\"$cluster_name\\") | .id" )

# 生成注册命令
create_token_data()
{
cat <<EOF
{
"clusterId": "$cluster_ID"
}
EOF
}

curl -k -X POST \\
    -H "Authorization: Bearer \${api_token}" \\
    -H 'Accept: application/json' \\
    -H 'Content-Type: application/json' \\
    -d "$(create_token_data)" $api_url/v3/clusterregistrationtokens

`}</code></pre>
    <h2 {...{
      "id": "4-获取主机注册命令"
    }}>{`4. 获取主机注册命令`}</h2>
    <p>{`复制并保存以下内容为脚本文件，修改前三行`}<inlineCode parentName="p">{`api_url`}</inlineCode>{`、`}<inlineCode parentName="p">{`token`}</inlineCode>{`、`}<inlineCode parentName="p">{`cluster_name`}</inlineCode>{`，然后执行脚本。`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`#!/bin/bash

api_url='https://xxx.domain.com'
api_token='token-5zgl2:tcj5nvfq67rf55r7xxxxxxxxxxx429xrwd4zx'
cluster_name=''

cluster_ID=$( curl -s -k -H "Authorization: Bearer \${api_token}" $api_url/v3/clusters | jq -r ".data[] | select(.name == \\"$cluster_name\\") | .id" )

# nodeCommand
curl -s -k -H "Authorization: Bearer \${api_token}" $api_url/v3/clusters/\${cluster_ID}/clusterregistrationtokens | jq -r .data[].nodeCommand

# command
curl -s -k -H "Authorization: Bearer \${api_token}" $api_url/v3/clusters/\${cluster_ID}/clusterregistrationtokens | jq -r .data[].command

`}</code></pre>
    </MDXLayout>;
}

